import PropTypes from "prop-types";
import * as SearchAPI from "./SearchAPI";
import React from "react";

const {Component} = require("react");
const leftArrow = "<";

class SearchNav extends Component {
    incrementPage = () => {
        this.props.incrementPage();
    }

    decrementPage = () => {
        this.props.decrementPage();
    }

    setLastPage = () => {
        this.props.setLastPage();
    }

    setFirstPage = () => {
        this.props.setFirstPage();
    }

    render () {
        const response = this.props.response;
        const currentPage = this.props.currentPage;
        const lastPage = response.data.pagination.last;
        if (response === undefined) {
            return (<button>Loading</button>);
        }
        if (lastPage === 1) {
            return (<button onClick={this.setFirstPage}> 1 </button>);
        }
        if(response.data.pagination.last === currentPage) {
            return (
                <React.Fragment>
                    <button onClick={this.setFirstPage}> 1 </button>
                    <button onClick={this.decrementPage}> {leftArrow} </button>
                    <button disabled> {currentPage} </button>
                </React.Fragment>
            )
        } else if (currentPage === 1 && response.data.pagination.last !== 1) {
            return (
                <React.Fragment>
                    <button disabled> 1 </button>
                    <button onClick={this.incrementPage}> > </button>
                    <button onClick={this.setLastPage}> {response.data.pagination.last} </button>
                </React.Fragment>
            )
        } else if (currentPage === 2) {
            return (
            <React.Fragment>
                <button onClick={this.setFirstPage}> 1 </button>
                <button disabled> 2 </button>
                <button onClick={this.incrementPage}> > </button>
                <button onClick={this.setLastPage}> {response.data.pagination.last} </button>
            </React.Fragment>
            )
        }
        return (
        <React.Fragment>
            <button onClick={this.setFirstPage}> 1 </button>
            <button onClick={this.decrementPage}> {leftArrow} </button>
            <button disabled> {currentPage} </button>
            <button onClick={this.incrementPage}> > </button>
            <button onClick={this.setLastPage}> {response.data.pagination.last} </button>
        </React.Fragment>);
    }
}

export default SearchNav;

SearchNav.propTypes = {
    response: PropTypes.array,
    currentPage: PropTypes.number,
    incrementPage: PropTypes.func.isRequired,
    decrementPage: PropTypes.func.isRequired,
    setFirstPage: PropTypes.func.isRequired,
    setLastPage: PropTypes.func.isRequired
};
